import React from 'react'
import './Navigation.css'
import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid';
import { ButtonGroup } from '@material-ui/core';
import MenuIcon from '@material-ui/icons/Menu';





export default function Navigation() {
    return (
        <div>
            <Grid className="Navigation-Parent"  justify="flex-start"  container  >
                <Button variant="outlined" color="primary" item>  Home   </Button>
                <Button variant="outlined" color="primary" item>  About   </Button>
                <Button variant="outlined" color="primary" item>  Skills   </Button>
                <Button variant="outlined" color="primary" item>  Projects   </Button>
                <Button variant="outlined" color="primary" item>  Contact   </Button>

                <MenuIcon/>
            </Grid>

            
        </div>
    )
}
